function App() {

  return (
    <div>
      <h2>Design is my life</h2>
      <p>Grapic and web design are far more than a job</p>
      <ul>
        <li>facebook</li>
        <li>Twitter</li>
        <li>Instagram</li>
      </ul>
    </div>
  );
}

export default App;
